package com.example.weather.repository;import lombok.Getter;import lombok.Setter;import javax.persistence.Column;import javax.persistence.Entity;import javax.persistence.Table;@Entity@Table(name = "clouds")@Getter@Setterpublic class CloudsEntity extends BaseEntity {    @Column(name = "clouds_ref_Id")    public void setRefId(Long refId) {        super.setRefId(refId);    }    @Column (name = "clouds_all")    private int all;}